import React from 'react';
import babydepp from '../../assets/images/johnnybaby';
import babydepp2 from '../../assets/images/johnnybaby2';
import babydepp3 from '../../assets/images/johnnybaby3';
import AwesomeSlider from 'react-awesome-slider';


const Carousel = (props) => {


return(
    <AwesomeSlider >
    <div data-src={babydepp} />
    <div data-src="/path/to/image-1.jpg" />
    <div data-src="/path/to/image-2.jpg" />
    <div data-src="/path/to/image-3.jpg" />
  </AwesomeSlider>
)
}
export default Carousel
